  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Flint Hills NWR
  outlines Refuge accomplishments during the 1981 calendar year. The report begins
  with an introduction to the Refuge and information about weather conditions, habitat
  conditions, land acquisition, and the system status. Construction, maintenance,
  and wildfires are also described. Habitat management is covered; croplands, grasslands,
  wetlands, and forests are discussed. The wildlife section of the report discusses
  endangered and threatened species, migratory birds, and game mammals. Interpretation
  and recreation activities are outlined; topics include information and interpretation,
  recreational uses, and law enforcement. Field investigations, cooperative programs,
  items of interest, photographs, brochures, and safety information are attached.\",\n\t\"license_title\":
